CREATE DATABASE sql_improvement;
USE sql_improvement;

CREATE TABLE jobs (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT,
  name VARCHAR(255),
  description VARCHAR(255),
  detail VARCHAR(255),
  business_skill VARCHAR(255),
  knowledge VARCHAR(255),
  location VARCHAR(255),
  activity VARCHAR(255),
  salary_statistic_group VARCHAR(255),
  salary_range_remarks VARCHAR(255),
  restriction VARCHAR(255),
  remarks VARCHAR(255),
  PRIMARY KEY (id)
);

CREATE TABLE personalities (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT,
  name VARCHAR(255),
  PRIMARY KEY (id)
);

CREATE TABLE jobs_personalities (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT,
  job_id INT UNSIGNED,
  personality_id INT UNSIGNED,
  CONSTRAINT `fk_jp_job_id` FOREIGN KEY (job_id) REFERENCES jobs (id),
  CONSTRAINT `fk_personality_id` FOREIGN KEY (personality_id) REFERENCES personalities (id),
  PRIMARY KEY (id)
);

CREATE TABLE practical_skills (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT,
  name VARCHAR(255),
  PRIMARY KEY (id)
);

CREATE TABLE jobs_practical_skills (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT,
  job_id INT UNSIGNED,
  practical_skill_id INT UNSIGNED,
  CONSTRAINT `fk_jps_job_id` FOREIGN KEY (job_id) REFERENCES jobs (id),
  CONSTRAINT `fk_practical_skill_id` FOREIGN KEY (practical_skill_id) REFERENCES practical_skills (id),
  PRIMARY KEY (id)
);
